import logo from './logo.svg';

import CovidChart from './components/CovidChart';
import './App.css';

function App() {
  fetch("https://covid-api.mmediagroup.fr/v1/cases?country=Australia").then(res => res.json())
        .then((result) => {
            console.log(result);
        })
  return (
    <div className="App">
      <CovidChart/>
    </div>
  );
}

export default App;
